            "created": 1421209931000, 
            "description": "<p>Pandas is a powerful and flexible Python library that provides data structures and operations for processing and analyzing tabular datasets. Come learn how Pandas can help you explore, transform, combine, and slice-and-dice medium-sized datasets with ease. Along the way, we will touch on the basics of functional programming, making plots, and integrating Pandas with other Python data libraries.</p> <p><b>Prereqs:</b><br/>* Comfortable with the basics of Python (or a similar language like Ruby)<br/>* Familiar with tabular data format (e.g. you can read an Excel spreadsheet)</p> <p><b>Installs (please have these installed before class):</b><br/>* pandas<br/>* ipython with notebook dependencies<br/>* (optional) matplotlib<br/>* (super optional) virtualenv, virtualenvwrapper<br/>`pip install pandas \u201cipython[notebook]\u201d matplotlib`</p> <p><b>Speakers:\u00a0</b></p> <p><b>Clara Bennett</b>, <i>Software Engineer @ Picwell</i><br/>Clara works on building APIs and data pipelines in order to serve Picwell\u2019s health insurance recommendations to customers. She uses Pandas to develop extract-transform-load processes for health plan data, as well as for her personal tabular data needs, because Excel is terrible.</p> <p><b>Tyler Jorgensen</b><i>, Data Scientist @ Picwell</i><br/>Tyler uses Pandas for essentially all of the data work that goes into Picwell\u2019s product prototypes, which involves processing and transforming millions of health claims. He has previously worked in related analytical roles in both financial services and management consulting.</p>", 
